  false,\n\t\"url\": null,\n\t\"notes\": \"The purposes of this study were to (1)
  continue monitoring on Leach's forktail (Oceanadroma furcata) and on fork-tailed
  storm petrels (Oceanodroma leucorhoa); (2) evaluate the feasibility of monitoring
  glaucous winged gulls (Larus glaucescens), tufted puffins (Lunda cirhatta), murres
  (Uria species), and rhinoceros auklets (Cerorhinca monocerrata); and (3) document
  man made disturbances on St. Lazaria.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
